import './App.css';

import Navbar from './Components/Navbar';
import Hero from './Components/Hero';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route, 
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/about">
          <Hero/>
        </Route>
      </Switch>
      <Navbar></Navbar>
      <Hero></Hero>
    </div>
  );
}

export default App;
